import "./Admin.css";

import React from "react";
import Sidebar from "./Sidebar";
import SidebarButton from "./SidebarButton";
import { WrenchIcon, HomeIcon, UserIcon } from "../../Global";

const Admin = () => {
	return (
		<div id="admin-page">
			<Sidebar id="side-bar">
				<h2>Hệ thống</h2>
				<SidebarButton icon={HomeIcon} onClick ={() => console.log("good")}>Thực đơn </SidebarButton>
				<SidebarButton icon={UserIcon}>Khách hàng</SidebarButton>
				<SidebarButton icon={WrenchIcon}>Quản lý</SidebarButton>
			</Sidebar>
		</div>
	);
};

export default Admin;
